import React from 'react';
//import Service from '../services/UserService';


const Navbar = (props)=> {

    return (
        <nav className="Navbar">
            <Link to="/">Home Page</Link>
            <br />
            <Link to="/all-mangas">All Mangas</Link>
            <br />
            {!props.loggedInUser && <Link to="/signup">Sign Up</Link>}
            <br />
            {!props.loggedInUser && <Link to="/login">Log In</Link>}
            <br />
            {props.loggedInUser && <Link to="/profile">Profile</Link>}
        </nav>
	);
}

export default Navbar;
